import React, { Component } from "react";
import {StyleSheet, View, Image, ImageBackground, TextInput, Text} from "react-native";

function ChangeGroupPage(props) {
    return (
        <View style={styles.container}>
            <ImageBackground
                source={require("../assets/images/image_rjQC..png")}
                resizeMode="contain"
                style={styles.image1}
                imageStyle={styles.image1_imageStyle}
            >
            </ImageBackground>
            <View style={styles.SectionStyle}>
                <TextInput
                    style={styles.inputStyle}
                    onChangeText={(time) => setTime(time)}
                    underlineColorAndroid="#f000"
                    placeholder="Zadaj čas"
                    placeholderTextColor="#8b9cb5"
                    returnKeyType="next"
                    blurOnSubmit={false}
                />
            </View>
            <Text style={styles.datumTreningu1}>Dátum tréningu</Text>
            <View style={styles.SectionStyle}>
                <TextInput
                    style={styles.inputStyle}
                    onChangeText={(date) => setDate(date)}
                    underlineColorAndroid="#f000"
                    placeholder="Zadaj dátum"
                    placeholderTextColor="#8b9cb5"
                    returnKeyType="next"
                    blurOnSubmit={false}
                />
            </View>
        </View>

    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1
    },
    image1: {
        height: 826,
        width: 465,
        marginTop: -7,
        marginLeft: -49
    },
    image1_imageStyle: {},
    materialDisabledTextbox: {
        height: 43,
        width: 360,
        marginTop: 279,
        marginLeft: 68
    }
});

export default ChangeGroupPage;
